public static void process(int[] data, 
                          int min, 
                          int max){ 
  int result = 0; 
  for( int val : data ) 
    if( val >= min && val <= max ) 
      result++; 
    else 
      result--; 
  for(int i = 0; i < data.length; i++) 
    data[i] += result; 
}

What must the pre-condition for method search be so 
that it always fulfills its post-condition? 



be any duplicated values. 


/* pre: see question 30 
   post: return an index in data
         that contains tgt.
         If tgt is not present return -1. 
*/
public static int search(int tgt, 
                         int[] data){ 
  int high = data.length - 1; 
  int low = 0; 
  int mid = (low + high) / 2; 
  while( data[mid] != tgt && low <= high){ 
    if( data[mid] > tgt ) 
      low = mid + 1; 
    else 
      high = mid - 1; 
    mid = (low + high) / 2; 
  } 
  if( data[mid] == tgt ) 
    return mid; 
  else 
    return -1; 
}

