public class Structure 
<E extends Comparable<E>>{
  private ArrayList<E> con; 
  public Structure(){ 
    con = new ArrayList<E>(); 
  } 
  public boolean isEmpty(){ 
    return con.size() == 0; 
  } 
  public E get(){ 
    return con.get(0); 
  } 
  public E remove(){ 
    return con.remove(0); 
  } 
  public void add(E obj){ 
    int pos = <*1>;
    boolean done = false; 
    E temp; 
    while( pos > 0 && !done ){ 
      temp = con.get( pos - 1 ); 
      done = obj.compareTo( temp ) >= 0; 
      if( !done ) 
        pos--; 
    } 
    con.add(pos, obj); 
  } 
  public String toString(){ 
    return con.toString(); 
  } 
}
